import ctypes
import pytest

#pjr = ctypes.CDLL('./car_parks.so')
datetime = ctypes.CDLL('./datetime.so')

class Time(ctypes.Structure):
    _fields_ = [("hours", ctypes.c_int),
                ("minutes", ctypes.c_int)]

class Date(ctypes.Structure):
    _fields_ = [("year", ctypes.c_int),
                ("month", ctypes.c_int),
                ("day", ctypes.c_int)]

