class Test_contatempo:

	def test_contatempo_1(self):
		ti = Time()
		ti.hours = 10
		ti.minutes = 50

		tf = Time()
		tf.hours = 12
		tf.minutes = 50

		di = Date()
		di.year = 2024
		di.month = 3
		di.day = 18

		df = Date()
		df.year = 2024
		df.month = 3
		df.day = 18


		result = datetime.contatempo(di, ti, df, tf)
		assert result == 120


	def test_contatempo_2(self):
		ti = Time()
		ti.hours = 23
		ti.minutes = 14

		tf = Time()
		tf.hours = 10
		tf.minutes = 35

		di = Date()
		di.year = 2023
		di.month = 8
		di.day = 23

		df = Date()
		df.year = 2023
		df.month = 8
		df.day = 27


		result = datetime.contatempo(di, ti, df, tf)
		assert result == 5001

	



